description:
Les informations relatives aux médicaments délivrés par les pharmacies de ville et remboursés par l'ensemble des régimes d'assurance maladie sont présentées annuellement pour les années 2012 à 2014 et mensuellement depuis l'année 2015.
Les fichiers présentent pour chaque médicament (identifié par son code CIP) :
* les classes d'appartenance du médicament (classes EphMRA, ATC5 et ATC2) ;
* la base de remboursement de l'Assurance Maladie ;
* le montant remboursé ;
* le dénombrement (nombre de boites remboursées).
Une ventilation selon le type de prescripteur (libéral ou salarié) est disponible :
* prescripteurs libéraux : prescripteurs de ville exerçant à titre libéral (ce qui inclut les praticiens exerçant au sein d'une clinique) ;
* prescripteurs salariés : prescripteurs exerçant à titre salarié (ces prescriptions émanent majoritairement de l'hôpital public).

Les ex-Directions générales des impôts et de la comptabilité publique ont fusionné en 2008 en une direction unique. Les Tableaux Statistiques de la Direction générale des Finances publiques (DGFiP) retracent l'activité de cette dernière pour une année civile de référence. Anciennement "Annuaire Statistique", l'ensemble des tableaux publiés ont été refondus à compter de l'année 2022.
Ils recensent les principales données relatives :
- aux fiscalités personnelle, professionnelle et directe locale; 
- aux moyens de paiement;
- au contrôle fiscal et au contentieux;
- aux affaires foncières et domaniales (cadastre, publicité foncière et domaine);
- aux amendes.
Retrouvez toutes les publications statistiques de la DGFiP sur le site [www.impots.gouv.fr](https://www.impots.gouv.fr/etudes-et-statistiques).
Les données fournies par la Direction générale des Finances publiques sont gratuites et peuvent être utilisées dans les conditions et limites fixées par la loi n° 78-753 du 17 juillet 1978.

Le SHOM, établissement public de référence en matière d'hydrographie et de sédiments marins, a été subventionné par la représentation de l'Etat en région Bretagne (SGAR) pour acquérir la connaissance initiale de l'environnement marin physique sur la zone de la ferme pilote d'hydroliennes du Fromveur et sur le tracé envisagé du câble de transport d'énergie.
Les données actuellement disponibles consistent en :
- un modèle numérique de terrain bathymétrique haute résolution limité à la zone de la ferme d'hydroliennes ;
- une carte à grande échelle de la nature des sédiments de surface ;
- un produit courants de marées 3D comprenant quatre couches, au pas de temps d'un quart d'heure (les données issues d'un profileur de courant localisé dans la zone sont également fournies).
Le complément des données sera mis à disposition sous un délai compris entre un et trois mois, fonction de la météo. Les données livrables ultérieurement consistent en :
- une carte à grande échelle de l'épaisseur des sédiments de surface de la zone de la ferme d'hydroliennes ;
- un modèle numérique de terrain bathymétrique haute résolution sur le tracé du câble sous-marin ;
- les données de sédimentologie relatives au tracé du câble sous-marin : nature et épaisseur des sédiments de surface.

Recensement des équipements sportifs réalisé par le Ministère des Sports
avec notamment :
-   type d'équipement (salle multisports, court de tennis, dojo, ...) ;
-   nature de l'équipement (intérieur, découvert, ...) ;
-   nature du sol (synthétique, parquet, béton, ...) ;
-   activités (danse, gymnastique, football, badminton, ...) ;
-   adresse et coordonnées GPS .
